description:
The Kingdom of Dreams and Madness

Arts Documentary hosted by Mami Sunada, published by Dwango in 2013 - Japanese narration


Information
------------------------------

A documentary directed by Japanese filmmaker Mami Sunada about Studio Ghibli's two founding directors Hayao Miyazaki and Isao Takahata. The documentary shows us the lives of the two directors over the span of a year during the production of their two films, The Wind Rises and The Tale of Princess Kaguya.

